    return (
        <div className='col-md-4'>
            <div class="card my-3">
                    <div class="card-body">
                        <h5 class="card-title">{note.title}</h5>
                        <p class="card-text">{note.description}</p>
                        <i class="far fa-edit mx-2 text-blue"></i>
                        <i class="far fa-trash-alt mx-2 text-danger"></i> 
                    </div>
            </div>
        </div>
    )
}

export default Note
